nacional.tokenizeString = function(string) {
        var stopWords = ["frente", "avenida", "edo", "estado", "calle", "los", "principal", "municipio", "mcpio"];
        return string.split(/[\s\.,;\:\\/\[\]\(\)\{\}]+/).map(function(val) {
            return val.toLowerCase();
        }).filter(function(val) {
            for (w in stopWords) {
                if (stopWords[w] == val) return false;
            }
            return true;
        }).map(function(word) {
            return {t: word, w: 1};
        });
};
